import { Card, Row, Col } from "react-bootstrap";

function ProductCard({ props }) {
  return (
    <>
      <Row xs={1} md={2} xl={4} className="g-4 m-2">
        {props.products.map((product, i) => (
          <Col>
            <Card products={props.products} />
          </Col>
        ))}
      </Row>
    </>
  );
}

export default ProductCard;
